import React, { useEffect, useState } from 'react';
import { Users } from './components/user_list'
import './App.css';

function App() {
  const [actualMode, setMode] = useState("default")
  const [content, setContent] = useState(<Users />)

  useEffect(() => {
    console.log("changing render...")
    if (actualMode === "default") {
      setContent(<Users />);
    } else if (actualMode === "create-user") {
      setContent(<h1>Not implemented</h1>);
    } else if (actualMode === "delete-user") {
      setContent(<h1>Not implemented</h1>);
    }
  }, [actualMode])

  function DefaultMode() {
    console.log("setting mode to default");
    setMode("default");
  }

  function CreateUserMode() {
    console.log("setting mode to create-user");
    setMode("create-user");
  }

  function DeleteUserMode() {
    console.log("setting mode to delete-user");
    setMode("delete-user");
  }

  const UnderlineIfSelected = (mode: string) => {
    return (mode === actualMode)? {textDecoration: 'underline'} : {}
  }

  return (
    <div className="App">
      <ul className='menu-bar'>
        <li key="default">
          <a href='#' onClick={DefaultMode} style={undefined}>Show</a>
        </li>
        <li key="create">
          <a href='#' onClick={CreateUserMode}>Create</a>
        </li>
        <li key="delete">
          <a href='#' onClick={DeleteUserMode}>Delete User</a>
        </li>
      </ul>
      {content}
    </div>
  );
}

export default App;
